// src/components/Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // Ensure this path is correct

const Home = () => {
  return (
    <div className="home">
      <header className="home-header">
        <h1>Welcome to Micro Credit</h1>
        <p>Your one-stop solution for managing and applying for loans efficiently.</p>
        <div className="home-buttons">
          <Link to="/login" className="home-button">Login</Link>
          <Link to="/signup" className="home-button">Sign Up</Link>
        </div>
      </header>
      <section id="explore" className="home-explore">
        <h2>Start Exploring</h2>
        <p>
          Explore is a well-organized tool that helps you get the most out of Micro Credit by providing structure to guide your progress towards the next step in managing your financial needs.
        </p>
        <Link to="/loan-form" className="explore-button">Get Started</Link>
      </section>
    </div>
  );
};

export default Home;
